import React from 'react';
import { 
    SafeAreaView, 
    View, 
    StyleSheet, 
    Text, 
    StatusBar } 
from 'react-native';

function ShowPost( { route } ){
    console.log(route.params.id)
    return(
        <Text>
            Show a single post 
        </Text>
    )
}

export default ShowPost;
